import React, { useState } from "react";
import "css/AuctionRegister.css";

const AuctionRegister = () => {
    const [isSelected, setSelected] = useState(false);
    return (
        <div className="AuctionRegisterContainer">
            <div className="seletedPopup">
                <button className="selectedPopup-button">SELECT</button>
            </div>
            <div className="AuctionRegister-content">
                <div className="register-toy">
                    { isSelected ? (
                        <button className="selectedBtn">Click</button>
                    ) : (
                    <div className="selectedToy">Toy Ficture</div>
                    )}
                </div>
            </div>
        </div>
    )
}

export default AuctionRegister;
